import React from 'react'
import Photo from '../../public/photo'

function Buddy({status}) {
    return (
        <div className='buddy'>
            <div className="message">
                <div className="photo">
                    {/* <Photo> */}
                        <div className="message-math">
                           <div className="nerbu">

                           </div>
                        </div>
                        <img src="userphoto.jpg" alt="buddyphoto"/>
                    {/* </Photo> */}
                </div>
                <div className="buddy-name">
                    <h4> name</h4>
                </div>
            </div>
            <div className={"buddy-status "+status}>
               {status ?<div className="deng">                 
                </div>:  <div></div>
                }
            </div>
            <style jsx> {`
                    .buddy {
                        width:100%;
                        margin-bottom:2vh;
                        display:flex;
                        justify-content:space-between;
                        align-items:center; 
                        padding:2vh; 
                        border-radius:10px;
                                                                    
                    }    
                    .message {
                         display:flex;
                    }
                    .buddy-name {                        
                        margin-left:2vh;
                    }
                    .photo {
                        position:relative;
                    }
                    .photo,img,.buddy-name {
                        width:60px;
                        height:60px;
                        border-radius:8px;                       
                    }
                    .message-math {
                        width:20px;
                        height:20px;
                        background:white;
                        position:absolute;
                        top: -2px;
                        right:2px;
                        border-radius:50%;
                        display:flex;
                        justify-content:center;
                        align-items:center;
                        box-shadow: 0 0 2px rgba(0,0,0,0.2);
                    }
                    .message-math>.nerbu {
                        width:13px;
                        height:13px;   
                        border-radius:50%;                 
                        background:green;
                    }
                    .buddy-status {
                        width:15px;
                        height:15px;
                        background:#2ad32d;
                        border-radius:50%;
                    }
                    .dow {
                        background:red;
                    }
                        `}
            </style>
        </div>
    )
}

export default Buddy
